import React from "react";
import { Button, Card } from "antd";

const PostCard = ({ post }) => {
  return (
    <div>
      <Card cover={post.Images[0]}>
        <Image />
        <Content />
        <Buttons></Buttons>
      </Card>
      <CommetForm />
      <Comments />
    </div>
  );
};

export default PostCard;
